Chastity is Tommy's nosy teen neighbor. She uninvitedly drops by his garage everyday to fill him in on her trivial teenage problems and exploits. After indirectly inspiring her to get a tattoo near here vagina (and with her eagerly wanting to show it off), Tommy finds himself in a bit of a pickle. And soon enough, Chastity finds a big juicy pickle inside of her.
